def plot_correlations():
    BLEU, iBLEU = "BLEU", "iBLEU"
    R_LEV, LEV = r"$LD_{S\rightarrow O}$", r"$MinLD_{O\rightarrow R}$"
    M2, GLEU, IMEASURE, SARI, MAX_SARI, GRAMMAR, UCCA_SIM = "M^2", "GLEU", "I-measure", "SARI", "MAX_SARI", "LT", "USim"
    HUMAN = "Human judgment correlations"
    MAEGE = "MAEGE correlations"

    names = [iBLEU, M2, GRAMMAR, BLEU, R_LEV, LEV, GLEU, MAX_SARI, SARI]
    human_ranks = [-0.05934065934065934, 0.7142857142857143, 0.5472527472527473, 0.2175824175824176, -
                   0.45054945054945056, 0.1912087912087912, 0.7318681318681318, 0.5516483516483517, 0.5692307692307692]
    maege_ranks = [0.41818181818181827, 0.06363636363636364, 0.9727272727272729, 0.5636363636363637, -
                   0.11818181818181818, -0.8636363636363636, 0.7363636363636363, -0.8090909090909091, -0.5454545454545455]
    assert(len(human_ranks) == len(maege_ranks))
    fig, ax = plt.subplots()
    ax.set_ylim(-1,1)
    ax.set_xlim(-1,1)
    sns.regplot(x=HUMAN, y=MAEGE, data=pd.DataFrame(np.transpose(
        [human_ranks, maege_ranks]), index=names, columns=[HUMAN, MAEGE]), ax=ax, ci=None)
    ymin, ymax = ax.get_ylim()
    bonus = (ymax - ymin) / 50
    for human, maege, name in zip(human_ranks, maege_ranks, names):
        ax.text(human, maege + bonus, name, color="#3498db")

    # fig.canvas.draw()
    print(pd.DataFrame(np.transpose(
        [human_ranks, maege_ranks]), index=names, columns=[HUMAN, MAEGE]))
    plt.show()

